import { gql } from "@apollo/client";

const GET_DATA = gql`
query GetData {
    categories {
    name
    products{
      name
      id
      category
      inStock
      description
      brand
      gallery
      attributes{
       name
        id
        type
        items{
          id
          value
          displayValue
        }
      }
      prices{
        currency{
          label
          symbol
        }
        amount

      } 
    }
  }

    currencies{
      label
      symbol
    }
  }
`;

export default GET_DATA;
